        ".\n\nPARTES CONTRATANTES: Prefeitura Municipal de Aparecida e:\n\nCT Nº 00194/2023",
        "pela Prefeitura Municipal de Aparecida para fornecer gás\n\nde cozinha, solicita a abertura de um Termo Aditivo ao Contrato nº\n\n00194/2023. O objetivo é reajustar o valor do botijão de gás de R$\n\n93,00 para R$ 115,00, devido ao aumento no preço do gás na\n\ndistribuidora. A empresa está arcando com um prejuízo de R$ 2,00\n\npor botijão vendido e, caso o preço não seja reajustado, há risco de\n\ndescontinuidade do serviço. A fundamentação legal para o reajuste é o\n\nArt. 65, II, d) da Lei nº 8.666/1993, que permite a alteração de\n\ncontratos administrativos para restabelecer o equilíbrio econômico-\n\nfinanceiro em caso de fatos imprevisíveis. O Termo Aditivo visa\n\ngarantir a justa remuneração do fornecimento de gás e a continuidade\n\ndo serviço à Prefeitura. VALOR ADITIVADO: R$ 13.200,00\n\n(TREZE MIL E DUZENTOS REAIS)"
